import React from "react";
import KnobDescribed from "./../../../../common/KnobDescribed/KnobDescribed";
import "./threshold-knob.scss";


const TresholdKnob = props =>{

    return (
        <KnobDescribed className={"treshold-knob " + props.className}
            showValue 
            scale={-100}
            alt={props.alt}
            initValue={0}
            quantize={.5} 
            onChange={ props.onChange }
            dobuleClickInit/>
    )
}

export default TresholdKnob;
